import React, { Component } from 'react';
import './Home.css'

class Home extends Component {
    render() {
        return (
            <div className='homeDesc'>
                <img src="/images/jamesportrait.jpg" class="portrait" />
                <p>I am a software developer living and working in New York City.</p>
                <p>My epxerience includes browser-based game development, full-stack application development, and frontend web design.
                    For the past four years, I have worked in the digital education field, building educational games and other online teaching tools
                    that are currently being used by thousands of teachers and millions of students across the United States.</p>
                <p>I primarily use JavaScript, ReactJS, NodeJS, CanvasJS, and CreateJS for my projects, but have experience in a multitude of other development and database technologies.</p>
            </div>
        )
    }
}

export default Home;
